
// Global Error Prevention

// Invoice List Fix: Handle missing client data
(function() {
  'use strict';
  
  // Cache for client data
  const clientCache = new Map();
  
  // Fetch client by ID
  async function fetchClientById(clientId) {
    if (!clientId) return null;
    
    // Check cache first
    if (clientCache.has(clientId)) {
      return clientCache.get(clientId);
    }
    
    try {
      const response = await fetch('/api/clients/' + clientId);
      if (response.ok) {
        const client = await response.json();
        clientCache.set(clientId, client);
        return client;
      }
    } catch (error) {
      console.warn('Failed to fetch client:', clientId);
    }
    
    return null;
  }
  
  // Enrich invoice with client data
  async function enrichInvoiceWithClient(invoice) {
    if (!invoice) return invoice;
    
    // If client already exists, return as is
    if (invoice.client && invoice.client.name) {
      return invoice;
    }
    
    // If clientId exists but no client object, fetch it
    if (invoice.clientId) {
      const client = await fetchClientById(invoice.clientId);
      if (client) {
        invoice.client = client;
      } else {
        // Fallback: create a minimal client object
        invoice.client = {
          id: invoice.clientId,
          name: 'Unknown Client',
          email: '',
          phone: ''
        };
      }
    } else {
      // No clientId at all, create placeholder
      invoice.client = {
        id: 'unknown',
        name: 'N/A',
        email: '',
        phone: ''
      };
    }
    
    return invoice;
  }
  
  // Enrich array of invoices
  async function enrichInvoices(invoices) {
    if (!Array.isArray(invoices)) return invoices;
    
    const enrichedInvoices = await Promise.all(
      invoices.map(invoice => enrichInvoiceWithClient(invoice))
    );
    
    return enrichedInvoices;
  }
  
  // Safe get invoice client name
  function getInvoiceClientName(invoice) {
    if (!invoice) return 'N/A';
    
    // Try different ways to get client name
    if (invoice.client && invoice.client.name) {
      return invoice.client.name;
    }
    
    if (invoice.clientName) {
      return invoice.clientName;
    }
    
    if (invoice.client_name) {
      return invoice.client_name;
    }
    
    return 'Unknown Client';
  }
  
  // Intercept fetch to auto-enrich invoice responses
  const originalFetch = window.fetch;
  window.fetch = async function(...args) {
    const response = await originalFetch.apply(this, args);
    
    // Clone the response to read it
    const clonedResponse = response.clone();
    
    // Check if this is an invoices API call
    if (args[0] && args[0].includes('/api/invoices')) {
      try {
        const data = await clonedResponse.json();
        
        // If it's an array of invoices, enrich them
        if (Array.isArray(data)) {
          const enrichedData = await enrichInvoices(data);
          
          // Return a new response with enriched data
          return new Response(JSON.stringify(enrichedData), {
            status: response.status,
            statusText: response.statusText,
            headers: response.headers
          });
        }
        
        // If it's a single invoice, enrich it
        if (data && data.id && data.clientId) {
          const enrichedData = await enrichInvoiceWithClient(data);
          
          return new Response(JSON.stringify(enrichedData), {
            status: response.status,
            statusText: response.statusText,
            headers: response.headers
          });
        }
      } catch (err) {
        // If JSON parsing fails, return original response
        return response;
      }
    }
    
    return response;
  };
  
  // Make functions globally available
  window.enrichInvoiceWithClient = enrichInvoiceWithClient;
  window.enrichInvoices = enrichInvoices;
  window.getInvoiceClientName = getInvoiceClientName;
  
  console.log('âœ… Invoice list fix loaded - Client data will be auto-fetched');
})();

(function() {
  'use strict';
  
  // Safe object property accessor
  window.safeAccess = function(obj, path, defaultValue = null) {
    if (!obj) return defaultValue;
    
    const keys = path.split('.');
    let current = obj;
    
    for (const key of keys) {
      if (current === null || current === undefined || !(key in current)) {
        return defaultValue;
      }
      current = current[key];
    }
    
    return current;
  };
  
  // Patch Array.prototype.map to handle undefined items
  const originalMap = Array.prototype.map;
  Array.prototype.map = function(callback, thisArg) {
    const result = [];
    for (let i = 0; i < this.length; i++) {
      if (i in this) {
        // Safely call callback with error handling
        try {
          result.push(callback.call(thisArg, this[i], i, this));
        } catch (error) {
          console.warn('Map callback error at index ' + i + ':', error.message);
          // Return a safe default or skip
          result.push(undefined);
        }
      }
    }
    return result;
  };
  
  // Global error handler for uncaught errors
  window.addEventListener('error', function(event) {
    if (event.message && event.message.includes('Cannot read properties of undefined')) {
      console.warn('Prevented undefined property access error:', event.message);
      event.preventDefault();
      return true;
    }
  });
  
  // Global promise rejection handler
  window.addEventListener('unhandledrejection', function(event) {
    if (event.reason && event.reason.message && 
        event.reason.message.includes('Cannot read properties of undefined')) {
      console.warn('Prevented undefined property access in promise:', event.reason.message);
      event.preventDefault();
    }
  });
  
  console.log('ðŸ›¡ï¸ Global error prevention active');
})();


// Extended Fix: Add all missing utility functions

// Invoice Fix: Safe data handling for invoice operations

// Safe get client name
function safeGetClientName(client) {
  if (!client) return 'N/A';
  return client.name || client.clientName || 'Unknown Client';
}

// Safe get client data
function safeGetClient(client) {
  if (!client) return {
    name: 'N/A',
    email: '',
    phone: '',
    companyName: ''
  };
  return {
    name: client.name || client.clientName || 'Unknown',
    email: client.email || '',
    phone: client.phone || '',
    companyName: client.companyName || client.company_name || ''
  };
}

// Safe get line items
function safeGetLineItems(items) {
  if (!items || !Array.isArray(items)) return [];
  return items.map((item, index) => ({
    description: item?.description || `Item ${index + 1}`,
    quantity: item?.quantity || 1,
    rate: parseFloat(item?.rate || 0),
    amount: parseFloat(item?.amount || 0)
  }));
}

// Safe calculate line item amount
function safeCalculateLineItemAmount(quantity, rate) {
  const qty = parseFloat(quantity || 0);
  const rt = parseFloat(rate || 0);
  return qty * rt;
}

// Safe get invoice data
function safeGetInvoiceData(invoice) {
  if (!invoice) return null;
  
  return {
    invoiceNumber: invoice.invoiceNumber || invoice.invoice_number || 'INV-000',
    issueDate: invoice.issueDate || invoice.issue_date || new Date().toISOString(),
    workStartDate: invoice.workStartDate || invoice.work_start_date || null,
    workEndDate: invoice.workEndDate || invoice.work_end_date || null,
    lineItems: safeGetLineItems(invoice.lineItems || invoice.line_items || []),
    subtotal: parseFloat(invoice.subtotal || 0),
    discountPercent: parseFloat(invoice.discountPercent || invoice.discount_percent || 0),
    vatPercent: parseFloat(invoice.vatPercent || invoice.vat_percent || 0),
    total: parseFloat(invoice.total || 0),
    companyName: invoice.companyName || invoice.company_name || 'Social Ads Expert',
    companyEmail: invoice.companyEmail || invoice.company_email || '',
    companyPhone: invoice.companyPhone || invoice.company_phone || '',
    companyAddress: invoice.companyAddress || invoice.company_address || '',
    brandColor: invoice.brandColor || invoice.brand_color || '#BFA1FE',
    currency: invoice.currency || 'BDT'
  };
}

// Make functions globally available
window.safeGetClientName = safeGetClientName;
window.safeGetClient = safeGetClient;
window.safeGetLineItems = safeGetLineItems;
window.safeCalculateLineItemAmount = safeCalculateLineItemAmount;
window.safeGetInvoiceData = safeGetInvoiceData;

console.log('âœ… Invoice safety functions loaded');


// Format Number (for balance, amounts, etc.)
function formatNumber(num) {
  if (num === null || num === undefined || num === '') return '0.00';
  const value = typeof num === 'string' ? parseFloat(num) : num;
  if (isNaN(value)) return '0.00';
  return value.toLocaleString('en-US', { minimumFractionDigits: 2, maximumFractionDigits: 2 });
}

// Parse Number (for form inputs)
function parseNumber(str) {
  if (!str || str === '') return 0;
  const num = typeof str === 'string' ? parseFloat(str.replace(/,/g, '')) : str;
  return isNaN(num) ? 0 : num;
}

// Calculate Balance (for transactions)
function calculateBalance(transactions) {
  if (!Array.isArray(transactions)) return 0;
  
  let balance = 0;
  transactions.forEach(t => {
    const amount = parseFloat(t.amount || 0);
    if (t.type === 'topup') {
      balance += amount;
    } else if (t.type === 'expense') {
      balance -= amount;
    }
  });
  return balance;
}

// Format Date (for display)
function formatDate(date) {
  if (!date) return '';
  const d = new Date(date);
  if (isNaN(d.getTime())) return '';
  return d.toLocaleDateString('en-US', { year: 'numeric', month: 'short', day: 'numeric' });
}

// Format Currency (with symbol)
function formatCurrency(amount, currency = 'BDT') {
  const num = formatNumber(amount);
  const symbol = currency === 'BDT' ? 'à§³' : currency === 'USD' ? '$' : 'â‚¬';
  return symbol + ' ' + num;
}

// Calculate Invoice Total
function calculateInvoiceTotal(lineItems, discountPercent = 0, vatPercent = 0) {
  if (!Array.isArray(lineItems)) return 0;
  
  let subtotal = 0;
  lineItems.forEach(item => {
    const amount = parseFloat(item.amount || 0);
    subtotal += amount;
  });
  
  const discount = (subtotal * parseFloat(discountPercent || 0)) / 100;
  const afterDiscount = subtotal - discount;
  const vat = (afterDiscount * parseFloat(vatPercent || 0)) / 100;
  const total = afterDiscount + vat;
  
  return total;
}

// Make functions globally available
window.formatNumber = formatNumber;
window.parseNumber = parseNumber;
window.calculateBalance = calculateBalance;
window.formatDate = formatDate;
window.formatCurrency = formatCurrency;
window.calculateInvoiceTotal = calculateInvoiceTotal;

